import TodoList from "./components/test/todolist/TodoList";
import NavigationBar from "./components/navigation-bar/NavigationBar";

function App() {
  return (
    <div className="max-w-xl m-auto bg-gray-200 mt-20">
      <NavigationBar />
      <TodoList />
    </div>
  );
}

export default App;
